import {
    VictoryBar,
    VictoryChart,
    VictoryAxis,
    VictoryTooltip,
    VictoryLine,
    VictoryGroup
} from "victory";
import { render } from "react-dom";
import data from "../components/Data/Data";

class AllStudentsGraph extends React.Component {
    constructor() {
        super()
    };


    render() {
        return (
            <VictoryChart>
                <VictoryBar
                    data={this.dataEvelyn}

                    x="project"
                    y="dificulty" />
            </VictoryChart>


        )
    }
};

export default AllStudentsGraph
